function getPosts() {
  fetch("https://jsonplaceholder.typicode.com/posts")
    .then((t) => t.json())
    .then((t) => {
      let e = "Posts";
      t.forEach((t) => {
        (e += `<div class="office" style="color: white; max-width: 350px">\n        <h3 class="office-title" id="uae-office">\n          ${t.title}\n        </h3>\n        <p class="office-content"  >${t.body}</p>\n        <a style="color: #c3323a; font-size: smaller;" class="oplus-link " href="https://goo.gl/maps/1q6Jn6sdnQKHtTZG7" target="_blank"\n        >GET DIRECTIONS</a\n      >\n          <hr>\n      </div>`),
          (a.innerHTML = e);
      });
    });
}
const a = document.getElementById("lol");
